INSERT INTO `kelasonline` VALUES (5,4,46,67,'Pengukuran','<p>Assalamu&#39;alaikum wr. wb.</p>\n\n<p>Selamat pagi semuanya. Tetap semangat PJJ Daring ON Line dengan SMAGA SMART.</p>\n\n<p>Kita berdoa terlebih dahulu.</p>\n\n<p>Agenda kegiatan kita hari Senin, 10 Agustus 2020 adalah :</p>\n\n<p>1. Membuka Menu Utama Pembelajaran yang berguna sebagai bukti kehadiran di KBM PJJ Daring ON Line dengan SMAGA SMART. Setelah selesai kegiatan, maka secara otomatis akan terrekap dalam&nbsp;<strong>JURNAL PEMBELAJARA</strong>N. Di dalam Jurnal tersebut disajikan data nama siswa yang hadir dan jumlah yang hadir, termasuk data nama siswa yang tidak hadir dan jumlah yang tidak hadir. J<em><strong>ADI SILAHKAN WAJIB MEMBUKA MENU UTAMA PEMBELAJARAN.</strong></em></p>\n\n<p>2. Membaca, melihat dan mendengarkan sajian materi yang disajikan yaitu&nbsp;<strong>Dinamika Rotasi dan Kesetimbangan Benda Tegar di SWAY&nbsp;</strong>yang disajikan berikut ini. Silahkan setelah mengikuti kegiatan kalian catat dalam buku catatan.&nbsp;</p>\n\n<p>Selamat belajar.</p>\n\n<p>Rendah hati tinggi prestasi Smaga Hebat.</p>\n\n<p>Wassalammu&#39;alaikum wr. wb.</p>\n','2020-10-08 19:05:00','2020-10-08 11:05:00',NULL,NULL,'2020-10-01 16:06:15','2020-10-01 19:11:44',NULL),(7,2,46,67,'Angka Penting','<p>Assalamu&#39;alaikum wr. wb.</p>\n\n<p>Selamat pagi semuanya. Tetap semangat PJJ Daring ON Line dengan SMAGA SMART.</p>\n\n<p>Kita berdoa terlebih dahulu.</p>\n\n<p>Agenda kegiatan kita hari&nbsp;<strong><em>Rabu, 12 Agustus 2020</em></strong>&nbsp;adalah :</p>\n\n<p>1. Membuka Menu Utama Pembelajaran yang berguna sebagai bukti kehadiran di KBM PJJ Daring ON Line dengan SMAGA SMART. Setelah selesai kegiatan, maka secara otomatis akan terrekap dalam&nbsp;<strong>JURNAL PEMBELAJARA</strong>N. Di dalam Jurnal tersebut disajikan data nama siswa yang hadir dan jumlah yang hadir, termasuk data nama siswa yang tidak hadir dan jumlah yang tidak hadir.&nbsp;<strong><em>J<strong>ADI SILAHKAN WAJIB MEMBUKA MENU UTAMA PEMBELAJARAN.</strong></em></strong></p>\n\n<p>2. Membaca, melihat dan mendengarkan sajian materi yang disajikan yaitu&nbsp;<strong>Angka penting di SWAY&nbsp;</strong>yang disajikan berikut ini. Silahkan setelah mengikuti kegiatan kalian catat dalam buku catatan.</p>\n\n<p>3. Kerjakan latihan soal angka penting, dan tidak usah dikumpulkan</p>\n\n<p>4. Rabu, 12 Agustus 2020 jam 11.05 pelaksanaan UH Susulan dan remidial</p>\n\n<p>&nbsp;</p>\n\n<p>Selamat belajar.</p>\n\n<p>Rendah hati tinggi prestasi Smaga Hebat.</p>\n\n<p>Wassalammu&#39;alaikum wr. wb.</p>\n','2020-10-05 01:38:00','2020-10-05 01:40:00',NULL,NULL,'2020-10-01 18:39:07','2020-10-01 18:39:07',NULL),(8,1,46,67,'Pengukuran, Angka Penting dan Vektor','<p>Assalamu&#39;alaikum wr. wb.</p>\n\n<p>Selamat pagi semuanya. Tetap semangat PJJ Daring ON Line dengan SMAGA SMART.</p>\n\n<p>Kita berdoa terlebih dahulu.</p>\n\n<p><strong><em>Agenda kegiatan kita hari SENIN, 24 Agustus 2020 adalah :</em></strong></p>\n\n<p>1. Membuka Menu Utama Pembelajaran yang berguna sebagai bukti kehadiran di KBM PJJ Daring ON Line dengan SMAGA SMART. Setelah selesai kegiatan, maka secara otomatis akan terrekap dalam&nbsp;<strong>JURNAL PEMBELAJARA</strong>N. Di dalam Jurnal tersebut disajikan data nama siswa yang hadir dan jumlah yang hadir, termasuk data nama siswa yang tidak hadir dan jumlah yang tidak hadir.&nbsp;<strong><em>J</em></strong><em><strong>ADI SILAHKAN WAJIB MEMBUKA MENU UTAMA PEMBELAJARAN.</strong></em></p>\n\n<p>2. Membaca, melihat dan mendengarkan sajian materi yang disajikan yaitu&nbsp;<strong>Power Point Vektor bias dilihat kembali di WA Group FISIKA X MIPA 2&nbsp;</strong>yang disajikan berikut ini. Silahkan setelah mengikuti kegiatan kalian catat dalam buku catatan.</p>\n\n<p>3. Kerjakan uji kompetensi halaman 31 &ndash; 35 Pilihan Ganda dan Essay, kerjakan di buku catatan. Jawaban dikirim di menu tugas.</p>\n\n<p>Selamat belajar.</p>\n\n<p>Rendah hati tinggi prestasi Smaga Hebat.</p>\n\n<p>Wassalammu&#39;alaikum wr. wb</p>\n','2020-10-03 01:59:00','2020-10-03 02:59:00',NULL,NULL,'2020-10-01 18:59:17','2020-10-03 00:26:20',NULL),(9,3,46,67,'GERAK LURUS BERATURAN DAN GERAK LURUS BERUBAH BERATURAN','<p>Agenda UH X Mipa 3 :</p>\n\n<p>1. KD 3.1 Menerapkan prinsip-prinsip pengukuran besaran fisis, ketepatan, ketelitian dan angka penting, serta notasi ilmiah</p>\n\n<p>Hari Senin , 5 Oktober 2020 jam 11.00 WIB</p>\n\n<p>2. KD&nbsp;3.2 Menerapkan prinsip penjumlahan vektor sebidang (misalnya perpindahan)</p>\n\n<p>Hari Senin , 12&nbsp;Oktober 2020 jam 11.00 WIB</p>\n\n<p>3. KD&nbsp;3.3 Menganalisis besaran-besaran fisis pada gerak lurus dengan kecepatan konstan (tetap) dan gerak lurus dengan percepatan konstan (tetap) berikut penerapannya dalam kehidupan sehari-hari misalnya keselamatan lalu lintas</p>\n\n<p>Hari Senin , 19&nbsp;Oktober 2020 jam 11.00 WIB</p>\n\n<p>4. KD 3.4 Menganalisis gerak parabola dengan menggunakan vektor, berikut makna fisisnya dan penerapannya dalam kehidupan sehari-hari</p>\n\n<p>Hari Senin , 2&nbsp;November&nbsp;2020 jam 11.00 WIB</p>\n\n<p>5. KD 3.5 Menganalisis besaran fisis pada gerak melingkar dengan laju konstan (tetap) dan penerapannya dalam kehidupan sehari-hari</p>\n\n<p>Hari Senin , 18&nbsp;November&nbsp;2020 jam 11.00 WIB</p>\n\n<h2><strong>materi lihat di GCR</strong></h2>\n','2020-10-03 02:01:00','2020-10-03 02:03:00',NULL,NULL,'2020-10-01 19:02:11','2020-10-01 19:02:11',NULL),(10,4,46,67,'GERAK LURUS BERATURAN DAN GERAK LURUS BERUBAH BERATURAN','<p>Agenda UH X Mipa 3 :</p>\n\n<p>1. KD 3.1 Menerapkan prinsip-prinsip pengukuran besaran fisis, ketepatan, ketelitian dan angka penting, serta notasi ilmiah</p>\n\n<p>Hari Senin , 5 Oktober 2020 jam 11.00 WIB</p>\n\n<p>2. KD&nbsp;3.2 Menerapkan prinsip penjumlahan vektor sebidang (misalnya perpindahan)</p>\n\n<p>Hari Senin , 12&nbsp;Oktober 2020 jam 11.00 WIB</p>\n\n<p>3. KD&nbsp;3.3 Menganalisis besaran-besaran fisis pada gerak lurus dengan kecepatan konstan (tetap) dan gerak lurus dengan percepat